import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import main from './pages/main';
import {BrowserRouter} from 'react-router-dom';

ReactDOM.render(
  <BrowserRouter>
    <App />
    <main />
  </BrowserRouter>,
  document.getElementById('root')
);
